import urllib.request
import sys
import os
import socket
socket.setdefaulttimeout(60)
#创建目录
def create_dir(dirpath):
    if not os.path.exists(dirpath):
        os.makedirs(dirpath)
class kl_download(object):
    """docstring for download"""
    def __init__(self, arg=None):
        super(kl_download, self).__init__()
        self.arg = arg

    def callbackfunc(self,blocknum, blocksize, totalsize):
        '''回调函数
        @blocknum: 已经下载的数据块
        @blocksize: 数据块的大小
        @totalsize: 远程文件的大小
        '''
        global url
        percent = 100.0 * blocknum * blocksize / totalsize
        if percent >= 100:
            percent = 100
        downsize=blocknum * blocksize
        if downsize >= totalsize:
            downsize=totalsize
        if __name__ == "__main__":
            s ="%.2f%%=>%.2f B/%.2f B \r"%(percent,downsize,totalsize)
            sys.stdout.write(s)
            sys.stdout.flush()
        if percent == 100:
            print('')
            return True

    def downfile(self,url,outdir='',outfilename=''):
        if not outfilename:
            outfilename=os.path.basename(url)
        try:
            create_dir(outdir)
            filepath=outdir+'/'+outfilename
            urllib.request.urlretrieve(url, filepath, self.callbackfunc)
            return filepath
        except Exception as e:
            print(e)
            return None

    def downimage(self,url,outdir='./',outfilename=''):
        if not outfilename:
            outfilename=os.path.basename(url)
        try:
            create_dir(outdir)
            filepath=outdir+'/'+outfilename
            opener=urllib.request.build_opener()
            req=urllib.request.Request(url)
            req.add_header('Referer',url)
            req.add_header('User-Agent','Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0;')
            r=opener.open(req)

            #写文件到本地
            respHtml = r.read();
            binfile = open(filepath, "wb");
            binfile.write(respHtml);
            binfile.close();

            return filepath
        except Exception as e:
            print(e)
            return None

